import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import HomeLayout from "../../layout/HomeLayout/HomeLayout";
import Splash from "../../components/splash/splash";
const PracticeQuestions = () => {
  const navigate = useNavigate();
  const [loading, setLoading] = useState(true);
  setTimeout(() => {
    setLoading(false);
  }, 2000);

  return (
    <HomeLayout>
      {loading ? (
        <Splash />
      ) : (
        <section
          style={{
            padding: "60px 24px 100px 24px",
            backgroundColor: "#f3f4f6",
            height: "auto",
            width: "100%",
          }}
        >
          <div
            style={{
              boxShadow:
                "rgba(40, 41, 61, 0.04) 0px 0px 1.19788px, rgba(96, 97, 112, 0.16) 0px 2.39577px 4.79153px",
              borderRadius: "10.2089px",
              width: "100%",
              backgroundColor: "#fff",
              padding: "12px",
              marginBottom: "3px",
            }}
          >
            <div
              style={{
                display: "flex",
                justifyContent: "space-between",
                alignItems: "center",
              }}
            >
              <p
                style={{
                  letterSpacing: "0.01em",
                  lineHeight: "24px",
                  fontWeight: "700",
                  fontSize: "20px",
                  marginBottom: "0",
                }}
              >
                dinner
              </p>
              <img src="/images/icons/swipe-left-right.svg" alt="hh" />
            </div>
            <div
              className="d-flex mt-2"
              style={{ display: "flex", marginTop: "8px" }}
            >
              <div
                className="d-flex align-items-start"
                style={{ display: "flex", marginTop: "8px" }}
              >
                <img
                  src="/images/icons/alarm-clock-check.svg"
                  alt=""
                  style={{ marginRight: "3px" }}
                />
                <p
                  className="font-medium font-12 mb-0"
                  style={{
                    opacity: "0.5",
                    fontWeight: "500",
                    fontSize: "12px",
                    marginBottom: "0",
                  }}
                >
                  3:14 pm
                </p>
              </div>
              <div
                className="d-flex align-items-start"
                style={{ marginLeft: "8px" }}
              >
                <img
                  src="/images/icons/repeat-02.svg"
                  alt=""
                  style={{ marginRight: "3px" }}
                />
                <p
                  className="font-medium font-12 mb-0"
                  style={{ opacity: "0.5" }}
                >
                  days
                </p>
              </div>
              <div
                className="d-flex align-items-start"
                style={{ marginLeft: "8px" }}
              >
                <img
                  src="/images/icons/sharp.svg"
                  alt=""
                  style={{ marginRight: "3px", opacity: "0.5" }}
                />
                <p
                  className="font-medium font-12 mb-0"
                  style={{ opacity: "0.5" }}
                >
                  Billu
                </p>
              </div>
            </div>
          </div>
        </section>
      )}
    </HomeLayout>
  );
};

export default PracticeQuestions;
